import React, {Component} from 'react';
import { NavLink, Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';
import '../style/style.css';

export class Navigation extends Component{
 render(){
    return (
    <Navbar className='nav p-3' expand="lg">
        <Navbar.Toggle aria-controls='basic-navbar-nav'/>
        <Navbar.Collapse id='basic-navbar-nav'>
        <Nav>
            <NavLink className='d-inline navlinks p-2  text-black' to="/">
                Home
            </NavLink>
            <NavLink className='d-inline navlinks p-2 text-black' to="/cars" >
                Cars
            </NavLink>
            <NavLink className='d-inline navlinks p-2 text-black' to="/carcategory">
                CarCategory
            </NavLink>


        </Nav>

        </Navbar.Collapse>


        <button className='d-inline p-3 bg-primary navbutton border-0 text-white' to="/carcategory">
                 Register
            </button>
            <Link to="/register" className="btn btn-primary">
        {/* <button className='d-inline p-3 bg-primary navbutton border-0 text-white' to="/carcategory">
                
            </button> */}
            Login
        </Link>
    </Navbar>      
    )
 }

}
